css:
.github-FilePatchView {
  display: flex;
  flex-direction: column;
  -webkit-user-select: none;
  cursor: default;
  flex: 1;
  min-width: 0;
}
.github-FilePatchView-header {
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 5px;
  padding-left: 10px;
  border-bottom: 1px solid rgba(0, 0, 0, 0.5);
}
.github-FilePatchView-header .btn {
  font-size: .9em;
}
.github-FilePatchView-header .btn.icon-move-up::before,
.github-FilePatchView-header .btn.icon-move-down::before {
  font-size: 1em;
  margin-right: .5em;
}
.github-FilePatchView-title {
  flex: 1;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
  margin-right: 10px;
}
.github-FilePatchView-container {
  flex: 1;
  overflow-y: auto;
}
.github-FilePatchView-container .is-blank,
.github-FilePatchView-container .large-file-patch {
  display: flex;
  height: 100%;
  align-items: center;
  justify-content: center;
  text-align: center;
  font-size: 1.2em;
  padding: 10px;
}
.github-FilePatchView-container .large-file-patch {
  flex-direction: column;
}
